$(function(){var t=!1,n=$("#tree"),i=$("#mSearch").val();$("#h-side-open").click(function(){t||$.get("/Profile/GetMenu",function(t){n.treeview({data:t,levels:1,enableLinks:!0,defaultSelection:i})});$("#h-side").addClass("show");$(".overlay").fadeIn()});$("#input-search").keypress(function(n){n.which==13&&$("#btn-search").trigger("click")});$("#btn-search").click(function(){n.treeview("collapseAll",{silent:!0});var t=$("#input-search").val();n.treeview("search",[t,{ignoreCase:!0,exactMatch:!1,revealResults:!0}])});$("#h-side-close, .overlay").click(function(){$("#h-side").removeClass("show");$(".overlay").fadeOut()});$("#hSearchbtn").click(function(){$("#hSearch").slideToggle()})});